var getUrlParam=function(url,paramName){return(decodeURIComponent((new RegExp("[?|&]"+paramName+"=([^&;]+?)(&|#|;|$)").exec(url)||[,""])[1].replace(/\+/g,"%20"))||null)};window.onload=()=>{if(getUrlParam(window.location.href,"authInfo")!==null){var firstScreenLoading=document.getElementById("firstScreenLoading");if(firstScreenLoading){document.body.removeChild(firstScreenLoading)}firstScreenLoading=null}};